 organizations for charitable purposes. In all cases, the applicant organization/program must have a clear charitable purpose. Applicants cannot have any delinquent reports for previous grants awarded through all Innovia Foundation’s grant programs. Innovia Foundation competitive grants are awarded to organizations providing services within the 20-county region served by the Foundation. (Eastern Washington Counties: Ferry, Stevens, Pend Oreille, Lincoln, Spokane, Adams, Whitman, Columbia, Garfield and Asotin. North Idaho Counties: Boundary, Bonner, Kootenai, Benewah, Latah, Nez Perce, Lewis, Clearwater, Shoshone and Idaho.) Interested communities should first review the rural checklist.'), ('0eaeeb95-5368-497f-997f-0ce89a1a52f0', '2025-07-30 12:32:37.513875+00', null, '[0.006973336,0.021252586,-0.037098605,-0.043408517,0.03422533,-0.015082588,0.026334284,0.017213603,-0.014213451,0.0036854642,0.054979373,0.02356547,0.051040776,0.09335334,0.032560576,-0.02210264,0.027529722,0.040880322,-0.018438967,0.014823823,-0.03843424,0.05380848,-0.04105207,0.025124619,-0.0020298513,-0.022850888,0.035253678,0.021077394,0.042243194,-0.016191652,0.059587862,-0.009689443,-0.04061909,-0.02417448,2.0103548e-06,-0.02771463,-0.014156036,0.0014046304,-0.04476822,-0.0011590593,0.0048754066,0.04413473,-0.02137789,0.0770963,-0.015529214,0.021034138,0.024482243,-0.037214175,-0.03203465,-0.030594047,0.002983232,-0.034492984,-0.009209726,-0.009010277,-0.025789278,0.09689144,-0.03777547,-0.053023543,0.041585617,0.03460972,-0.009499448,0.05357071,-0.028320553,-0.018369304,0.13083357,0.07088081,-0.038470242,0.008998167,-0.023484863,0.012222618,0.07810897,-0.032059845,-0.019591618,0.051755484,-0.053007107,0.031945635,-0.029319817,-0.010582009,-0.039733022,-0.015741516,-0.0010930047,0.015281475,-0.0075931814,0.051509198,0.06330399,0.00757376,-0.018292038,0.01359912,-0.037181366,0.003337722,0.06017827,-0.013461918,0.03923533,-0.023867453,-0.008532133,-0.051716033,-0.01892791,-0.054554284,-0.030594535