ency-humanitarian-action/news/article/crisis-and-support-centre-2024-humanitarian-innovation-call-for-projects', 'This call for projects aims to encourage the establishment of high-impact underlying solutions that benefit the whole sector, to improve the effectiveness of humanitarian action. It is fully aligned with the aims of the 2023 – 2027 French Humanitarian Strategy and seeks to ensure its implementation by supporting initiatives from humanitarian NGOs. The Humanitarian Innovation call for projects (APIH) was launched by the Humanitarian and Stabilization Operations Center (COHS) in 2021 in line with the commitments made at the French National Humanitarian Conference (CNH) and the recommendations of the external audit of the Emergency Humanitarian Fund (FUH).', 'Humanitarian and Stabilization Operations Center (COHS)', 'Initiatives from humanitarian NGOs.'), ('3925cb69-50c2-4a09-9f57-8a8f3ace9841', '2025-07-30 12:37:43.356355+00', null, '[-0.016498556,0.08608598,-0.022508789,0.009823717,-0.0021359562,0.010991997,0.047111448,0.059479803,0.016271692,0.005701426,-0.014747267,-0.0002056225,0.07757425,0.04725982,-0.011163671,-0.000548692,0.015005001,0.028534072,-0.016997807,0.0036025085,-0.028439408,0.025987407,-0.024797007,0.016645454,-0.034221224,0.0016215165,0.021346357,0.000484652,-0.016551144,-0.078589074,0.04205,-0.010214702,-0.023711117,-0.028164636,2.3373134e-06,-0.0007330919,-0.025297513,0.0022292587,0.00068051484,-0.002440186,-0.04900532,0.017271565,-0.023766538,0.0029333616,0.012072832,-0.040733963,0.012284062,0.039166998,-0.06778581,-0.013218212,0.030731533,-0.05567653,-0.0900288,-0.01472534,-0.06629442,0.07818334,0.026413746,-0.0443145,-0.037851848,-0.038132887,0.040048614,-0.0120575065,-0.018607734,0.025366256,-0.0018298035,0.029904755,-0.0072209085,-0.025435815,0.032726392,0.0072994377,0.10297955,-0.03578578,-0.009198104,0.017169934,-0.006181583,-0.043057404,-0.04011544,-0.05636384,0.009651134,-0.023885544,0.023286998,0.05712066,0.020026619,0.0138749