expenses. Receipts must be submitted no later than 15 days after the ICANN Public Meeting or eligible ICANN event. Funds may not be applied to: Travel, lodging, and meal expenses for meeting/event attendees, for the child, or for a caregiver. Ongoing childcare expenses that would already be incurred by the recipient. Childcare expenses incurred NOT in the city where the ICANN Public Meeting (or eligible ICANN event) is taking place. Toys, tickets to attractions (e.g., museums, amusement parks, etc.) Any other expenses related to the recipient's participation in the meeting/event that would already be incurred by the recipient attending the meeting/event. Any other expenses not specified under allowable expenses. ICANN reserves the right to deny reimbursement to applicants who misrepresent their funding needs.', 'ICANN', 'Applicant must be the parent or legal guardian of the child(ren) who will need childcare services while the applicant attends in person the ICANN Public Meeting or eligible ICANN event. Applicant must be registered and attend the ICANN Public Meeting or eligible ICANN event. Children must be 12 years or younger by the first day of the ICANN Public Meeting or eligible ICANN event. Childcare must be provided in the city or in the vicinity of where the ICANN Public Meeting or eligible ICANN event is taking place. Program participant must complete post-meeting program feedback survey. ICANN staff and Board members are not eligible for this program.'), ('4fa0dbad-dcb8-4084-8d3f-703d8d6163a8', '2025-07-30 12:39:28.128027+00', null, '[-0.020023633,0.033738185,0.0073005185,-0.015355734,-0.024353534,0.039618347,0.032255676,0.024594875,-0.0499845,-0.01770194,0.011541711,0.040533803,0.020799259,0.054986905,-0.042165246,-0.017254202,-0.021123169,0.07676731,-0.04961333,0.010026814,-0.006848225,0.043051675,-0.031432707,0.018143205,0.03321746,-0.024851786,-0.027839895,0.0062956777,-0.002850107,-0.021579405,0.04068873,0.01086391,-0.06566938,-0.04027261,2.5703614e-0