of London Foundation is offering up to £100,000 in Research funding through its new grant programme — designed to support projects that create real-world impact and build a safer, more resilient future. What we offer: Significant Grant Funding (Up to £100,000 for a one-year project or £50,000 per year for a two-year project, includes salary, core costs, and up to 18% indirect cost recovery), Expert Collaboration (Join a global network of researchers, institutions, and (re)insurance professionals creating meaningful change). Projects must demonstrate clear research methodology, practical, non-commercial outcomes, high academic quality, active engagement with non-academic stakeholders. Successful applicants must submit a report 12 months after funding, outlining outcomes, challenges, and financial spend. Presentations to the Foundation may also be requested.', 'Lloyd’s of London Foundation', 'Applications are welcome from: Independent researchers & academics, Research institutions, Public sector organisations, Registered charities, (Re)insurance industry participants. We’re looking for projects focused on: Risk understanding & management (aligned with UN Sustainable Development Goals), Climate adaptation and mitigation, Humanitarian and environmental risks such as floods, droughts, fires, and extreme weather events.'), ('8919beb2-b9dc-47a0-98f1-c176d9e18c15', '2025-07-30 12:39:28.473288+00', null, '[0.00097226334,0.05452514,-0.05894115,-0.038011145,-0.0002794686,-0.011324454,0.08622139,-0.016309896,0.028991183,0.027587533,0.065840155,0.038664933,0.037048046,0.102930814,0.035292424,-0.040882803,0.018914364,0.02697442,-0.025652245,0.0127482265,-0.013917884,0.015989186,-0.032838702,0.010092664,-0.050084937,-0.008201897,-0.013112724,0.008988647,0.023030112,-0.0015968457,0.024607722,-0.025654035,-0.067794695,-0.034128964,2.2563484e-06,-0.03030683,-0.046672646,0.006386608,-0.029803414,0.002511602,0.03324112,0.02268963,-0.0373364,0.044675242,-0.060766783,0.045121226,0.045675