, 'Global Good Fund Fellowship 2026 for Social Entrepreneurs', '$10,000', '2025-06-30', 'https://opportunitydesk.org/2025/06/09/global-good-fund-fellowship-2026/', 'The Global Good Fund Fellowship is a 12-month hybrid leadership program for social entrepreneurs around the world. They accelerate leaders who relentlessly tackle the most pressing social issues to create a more sustainable and just future for all. Each leader receives professional executive coaching, c-suite business mentorship, $10,000 to spend exclusively on their leadership development, customized tools, resources, training and networking opportunities to scale their social impact. They take a holistic approach to create change by building resilient, competent and successful leaders through the hybrid Fellowship. Fellows raise 3x the capital in service of social change because of the opportunities afforded by the program. This includes: 360° Assessment, Executive Coaching (Virtual), Business Mentorship (Virtual), Annual Summit (in-person), Targeted Funds ($10,000 grant for leadership development), Peer and Subject Matter Expert Network.', 'Global Good Fund', 'The enterprise that the candidate leads is at least two years old. The enterprise must have at least one full-time employee in addition to the candidate. The applicant is committed full-time to running their enterprise. Applicants should not be currently receiving formal coaching/mentoring support; if they are applying for other fellowships within the 2026 fellowship cycle, please make sure it is indicated within your application. The applicant must be in a position where they have primary decision-making authority. Additional Consideration: The enterprise the candidate is leading can be a for-profit, non-profit, or hybrid. The enterprise’s scope of work can be international, domestic, or both. The enterprise has developed an effective business model and is therefore well positioned (or can provide evidence that demonstrates a high level of pote