ughout its 20-county service area BUILD COMMUNITY through a resident-driven process and TAKE ACTION on what matters most to its residents. Hundreds of communities across the country have implemented the program and experienced outcomes such as: Increased participation in local community-decision making; Increased volunteerism; Increased investment in community-supported programs and activities; Increased economic development and downtown revitalization; Community endowment funds. Grants of $30,000 will support community-based project coordinators and actions in the selected communities for up to two years. Technical assistance, including program training and assigned certified coaches, will also be provided through the grant. The technical assistance is valued at $50,000.', 'Innovia Foundation', 'In order to be eligible, applicants must be a public charity with tax-exempt status under Section 501(c)(3) of the Internal Revenue Code; a federally recognized tribe; or a public entity such as a school district, municipality, or unincorporated group or association. In certain cases, grants can be awarded to non-501(c)(3) organizations for charitable purposes. In all cases, the applicant organization/program must have a clear charitable purpose. Applicants cannot have any delinquent reports for previous grants awarded through all Innovia Foundation’s grant programs. Innovia Foundation competitive grants are awarded to organizations providing services within the 20-county region served by the Foundation. (Eastern Washington Counties: Ferry, Stevens, Pend Oreille, Lincoln, Spokane, Adams, Whitman, Columbia, Garfield and Asotin. North Idaho Counties: Boundary, Bonner, Kootenai, Benewah, Latah, Nez Perce, Lewis, Clearwater, Shoshone and Idaho.) Communities must provide a $10,000 local match over the two-year grant period.'), ('ad21e1c9-cb24-40f5-bbcc-2243f8048157', '2025-07-30 12:37:43.436406+00', null, '[0.0012999754,0.067334026,-0.019276166,0.017125234,0.035244256,0.00090530