nities nationwide. They also recognize that local, community-based organizations are critical in offering support to the health and wellbeing of those they serve. For the fourth year, they are proud to renew their fund to support ten U.S.-based, local organizations serving the mental health of those in need with the Saks Fifth Avenue Foundation Local Grant Program. The Saks Fifth Avenue Foundation’s mission is to make mental health a priority in every community, especially those where support is most needed, by: Increasing awareness and education: Fostering conversations and supporting educational programs that break down the stigma of mental health issues. Improving access to care: Increasing the availability of resources to address mental health issues when and where they are needed most. Building protective factors: Strengthening attitudes, behaviors and relationships that build the foundation for mental health. Partnership opportunities for a minimum financial commitment of $10,000 and a maximum financial commitment of $30,000 this year. An overview of how the funds will directly make an impact. The total budget included in this application should add up to the amount requested (this is not your overall operating budget).', 'Saks Fifth Avenue Foundation', 'Organizations submitting a request for a grant must: Be a registered 501c3 non-profit that is in good standing and has been classified by the IRS as a U.S. public charity. Have been in existence for at least 1 year. Have a stated mission that focuses on direct access to mental health care or have a program with a stated focus on direct access to mental health care operating in the United States. Be nonpartisan. Priority will be given to organizations that have not received a Saks Fifth Avenue grant within the past two years, local organizations that are independent of larger systems or federated non-profits, and have an annual revenue under ten million dollars. Be able to provide a high-resolution imagery, log