nties of North Idaho. This family foundation was founded on the values of wisdom, integrity, and environmental stewardship. This program will consider applications from nonprofit organizations addressing a variety of program areas, including: Education and youth development, Arts and culture, Economic opportunity, Health and wellbeing, Quality of life. Grant amounts are typically between $5,000 and $30,000 and are provided for a one-year period.', 'Innovia Foundation', 'In order to be eligible, applicants must be a public charity with tax-exempt status under Section 501(c)(3) of the Internal Revenue Code; a federally recognized tribe; or a public entity such as a school district, municipality, or unincorporated group or association. In certain cases, grants can be awarded to non-501(c)(3) organizations for charitable purposes. In all cases, the applicant organization/program must have a clear charitable purpose. Applicants cannot have any delinquent reports for previous grants awarded through all Innovia Foundation’s grant programs. Innovia Foundation competitive grants are awarded to organizations providing services within the 20-county region served by the Foundation. (Eastern Washington Counties: Ferry, Stevens, Pend Oreille, Lincoln, Spokane, Adams, Whitman, Columbia, Garfield and Asotin. North Idaho Counties: Boundary, Bonner, Kootenai, Benewah, Latah, Nez Perce, Lewis, Clearwater, Shoshone and Idaho.) Nonprofit organizations addressing a variety of program areas for the benefit of the communities in Bonner and Boundary counties of North Idaho.'), ('b9a7aa01-985f-469f-9a75-c62c5c6ba502', '2025-07-30 12:32:37.62597+00', null, '[0.035098635,0.03839886,-0.025105119,0.001573497,-0.012972967,0.017307743,0.06506055,0.018894628,-0.043948576,-0.011652757,0.028072912,0.005708552,0.05587058,0.04826497,-0.019700458,-0.11282647,-0.05870913,0.02717568,-0.022584066,0.024846418,0.005613992,0.044264562,-0.043361746,0.01681469,-0.056642998,-0.038934913,-0.03902136,0.025463972,0