or young impact-driven founders to connect, learn, and grow. By applying to this initiative, you not only gain access to funding but also to a global community of change agents and experienced mentors dedicated to supporting youth-led innovation. The Global Innovation Challenge is a global call to action for young founders who are leading projects or startups aimed at solving pressing social or environmental problems. The initiative is designed to supercharge innovative, high-potential ventures led by young people. Whether your project is in its early stages or gaining traction, this challenge offers both the funding and support structure to take your initiative further. Selected applicants will be eligible for multiple grant awards, with funding ranging from $3,000 to $15,000 USD. A single submission makes you eligible for several funding streams, significantly increasing your chances of support. Beyond financial assistance, all finalists will receive free access to project development resources, a pitch coach, and exclusive learning materials to strengthen their initiatives and presentation skills. This program is about unlocking the potential of youth by equipping them with the tools and opportunities to thrive. It is open to applicants from all continents and does not restrict participation based on nationality, educational background, or organizational status. All that is required is a demonstrated commitment to social impact and a scalable, solution-oriented idea.', 'Social Shifters', 'Individuals aged 18–30. Founders or leaders of a startup or project focused on social or environmental impact. Applicants from any country or region. The challenge welcomes ideas in various fields including but not limited to climate change, health, education, human rights, economic development, and technology for good.'), ('c2d8683b-0712-4e25-ab20-36f085b0bf0a', '2025-07-30 12:39:28.282741+00', null, '[0.0077851666,0.078072004,-0.037326235,-0.0004955371,-0.002832232,-0.00799734