6279,-0.032475393,-0.015903115,0.024149673,-0.0083811255,0.027953027,0.03450158,0.02906909,0.036423378,3.231428e-34,-0.037084203,-0.03235611,0.02249552,0.03522835,0.0071393903,0.01843624,0.035244603,-0.01806932,-0.03315884,0.030918514,0.026930487]', 'created', 'ICANN Grant Program', '$500,000', '2024-03-25', 'https://www.icann.org/grant-program-en', 'The ICANN Grant Program is a global grant-making program funded by the proceeds received from last-resort auctions in the 2012 New gTLD Program. This program will make a difference in the Internet ecosystem, while also positively impacting people all over the world by investing in creative and innovative solutions that further ICANN's vision of a single, open, and globally interoperable Internet. The types of initiatives that the ICANN Grant Program will fund include those that support ICANN's mission by: Benefitting the development, distribution, and evolution of the services and systems that support the Internet's unique identifier systems. Providing capacity development. Advancing developments, innovation, and open standards for the benefit of the Internet community. Contributing to diversity, participation, and inclusion across stakeholder communities and geographic regions. All proposed activities also must not duplicate existing activities currently or previously funded by ICANN. The total net auction proceeds fund amounts to $217 million as of 30 June 2023 and are segregated from ICANN's general Operations. This may not be the final amount of proceeds available for distribution, as a portion of the auction proceeds funds under management are still subject to disputes. Additionally, costs to run the program will be covered by the auction proceeds fund. The Grant Program will operate in a series of cycles. During each cycle, a portion of the total fund will be available for distribution for successful applications. The maximum project duration is 24 months. The total amount available for grants in this first cycle is $10 million. Applications can be submitted for grant awards between $50,000 and $500,000. These award thresholds are for the first cycle only and will be reassessed for future cycles.', 'Internet Corporation for Assigned Names and Numbers (ICANN)', 'To be eligible applicants must: Be a charitable organization. Organizations within the U.S. must have a 501(c)(3) determination from the Internal Revenue Service (IRS). Applicants outside of the U.S. must be charitable in nature and be able to provide relevant governing and financial documentation, upon ICANN’s request, to confirm equivalency to a U.S. 501(c)(3). Support ICANN’s compliance with relevant U.S. laws, rules, and regulations. Have no conflicts of interest. Meet due diligence standards. Have a bank account in the applicant organization’s name. Ineligible activities include: Any political or lobbying activity, including activities to influence legislation and/or the outcome of any specific public election, or to carry on, directly or indirectly, any voter registration drive. Any activity that may lead to private financial benefit of individuals beyond incidental items such as payment of reasonable employment salaries. Any unlawful activity according to the country where the applicant is based and/or where the project is developed.'), ('d91d80c9-ba74-4723-a751-395be2dbfe29', '2025-07-30 12:39:31.920906+00', null, '[0.043515354,0.06570258,-0.051195674,0.015970519,0.02299495,-0.002734443,0.0064472486,-0.0009799041,-0.0042655184,0.020029394,0.04798422,-0.026458194,0.074029446,0.12537453,0.029944612,0.003854907,0.011462329,0.034553334,-0.03647231,0.031202411,-0.029117215,0.018151192,-0.0019827269,0.03143188,0.009437073,0.004275889,0.025969308,0.024967873,-0.023981128,-0.02921251,0.026784178,-0.02212743,-0.063633196,0.0043986966,2.2508e-06,-0.07516269,-0.038761526,-0.009836817,-0.031352386,0.021955363,0.013660727,0.06846775,-0.061001908,0.04270269,-0.04124301,0.00083249185,0.020227384,-0.0033305439,-0.025198339,0.