with local community partners, Innovia annually identifies a Community Grants funding theme. While we are committed to funding projects across all our impact areas, when possible, we will prioritize proposals that align with the annual theme. This year’s theme is Youth Engagement, with an aim to increase opportunities for young people to participate in community events and activities that build relationships and decrease isolation.', 'Innovia Foundation', 'In order to be eligible, applicants must be a public charity with tax-exempt status under Section 501(c)(3) of the Internal Revenue Code; a federally recognized tribe; or a public entity such as a school district, municipality, or unincorporated group or association. In certain cases, grants can be awarded to non-501(c)(3) organizations for charitable purposes. In all cases, the applicant organization/program must have a clear charitable purpose. Applicants cannot have any delinquent reports for previous grants awarded through all Innovia Foundation’s grant programs. Innovia Foundation competitive grants are awarded to organizations providing services within the 20-county region served by the Foundation. (Eastern Washington Counties: Ferry, Stevens, Pend Oreille, Lincoln, Spokane, Adams, Whitman, Columbia, Garfield and Asotin. North Idaho Counties: Boundary, Bonner, Kootenai, Benewah, Latah, Nez Perce, Lewis, Clearwater, Shoshone and Idaho.) Organizations are eligible to submit one application per cycle.'), ('e732c459-0c20-4b38-ab89-62a875f63f5b', '2025-07-30 12:39:28.737453+00', null, '[-0.011805955,0.043120343,-0.017150607,0.006023147,0.006175367,-0.0069474257,0.038628735,-0.04755827,0.0027491576,-0.0052494756,0.06897585,0.060821723,-0.006280596,0.09740371,0.066195756,-0.035080593,0.065197535,-0.008892524,-0.07006813,0.017757168,-0.027833924,-0.025431653,0.0006489589,-0.013460311,-0.021307316,0.0023484754,-0.05077523,0.050392624,0.019755917,-0.03637295,0.057755128,0.03164431,-0.012874388,-0.044697024,2.6133314e-